SET FOREIGN_KEY_CHECKS=0;

CREATE DATABASE IF NOT EXISTS login;

USE login;

DROP TABLE IF EXISTS agenda_datos;

CREATE TABLE `agenda_datos` (
  `nombre` varchar(60) NOT NULL,
  `apellidos` varchar(60) NOT NULL,
  `direccion` varchar(60) NOT NULL,
  `celular` varchar(60) NOT NULL,
  `email` varchar(60) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS country;

CREATE TABLE `country` (
  `country_id` int(11) NOT NULL AUTO_INCREMENT,
  `country_name` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`country_id`)
) ENGINE=InnoDB AUTO_INCREMENT=45 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;




DROP TABLE IF EXISTS productos;

CREATE TABLE `productos` (
  `id_cliente` int(11) NOT NULL AUTO_INCREMENT,
  `codigo_producto` varchar(20) NOT NULL,
  `nom_cliente` varchar(100) NOT NULL,
  `telefono` varchar(30) NOT NULL,
  `identidad` double NOT NULL DEFAULT '0',
  PRIMARY KEY (`id_cliente`),
  UNIQUE KEY `codigo_producto` (`codigo_producto`)
) ENGINE=MyISAM AUTO_INCREMENT=5460 DEFAULT CHARSET=utf8;




DROP TABLE IF EXISTS restaurants;

CREATE TABLE `restaurants` (
  `restaurant_name` varchar(20) NOT NULL,
  `cuisine_type` varchar(20) NOT NULL
) ENGINE=MyISAM DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS table_name1;

CREATE TABLE `table_name1` (
  `id` bigint(20) NOT NULL,
  `title` varchar(59) NOT NULL,
  `url` varchar(59) NOT NULL,
  `blog_title` varchar(59) NOT NULL,
  `mai` int(59) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1 ROW_FORMAT=COMPACT;




DROP TABLE IF EXISTS users;

CREATE TABLE `users` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  `email` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  `password` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `gender` enum('Male','Female') COLLATE utf8_unicode_ci NOT NULL,
  `phone` varchar(15) COLLATE utf8_unicode_ci NOT NULL,
  `created` datetime NOT NULL,
  `modified` datetime NOT NULL,
  `status` enum('1','0') COLLATE utf8_unicode_ci NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;




SET FOREIGN_KEY_CHECKS=1;